//Core
import easyinvoice from 'easyinvoice';
//Helpers

const generateInvoice = (data) => {
  const { totalPriceDetails, customerDetails, order_id, currency, campaigns } =
    data;

  const boughtCampaigns = [];

  campaigns.map((service) => {
    service.total != 0 &&
      service.campaigns.map((campaign) => {
        campaign.campaignObject.campaign.map((boughtCampaign) => {
          const countries =
            boughtCampaign.value.targets &&
            boughtCampaign.value.targets.length != 0 &&
            'Targeting:' +
              boughtCampaign.value.targets.map((item) => item.text + ' ');

          if (service.service == 'spotify') {
            boughtCampaigns.push({
              quantity: 1,
              description:
                campaign.campaignObject.type == 'pre-release'
                  ? campaign.campaignObject.release.text
                  : campaign.campaignObject.track +
                    ' | ' +
                    boughtCampaign.value.text,
              'tax-rate': totalPriceDetails.VAT == 1.21 ? 21 : 0,
              price: boughtCampaign.value.costEUR,
            });
          } else if (service.service == 'youtube') {
            boughtCampaigns.push({
              quantity: 1,
              description:
                campaign.campaignObject.type == 'pre-release'
                  ? campaign.campaignObject.release.text
                  : campaign.campaignObject.track +
                    ' | ' +
                    boughtCampaign.label +
                    ' | ' +
                    boughtCampaign.value.text +
                    ' | ' +
                    countries,

              'tax-rate': totalPriceDetails.VAT == 1.21 ? 21 : 0,
              price: boughtCampaign.value.costEUR,
            });
          } else {
            boughtCampaigns.push({
              quantity: 1,
              description:
                campaign.campaignObject.type == 'pre-release'
                  ? campaign.campaignObject.release.text
                  : campaign.campaignObject.track +
                    ' | ' +
                    boughtCampaign.label +
                    ' | ' +
                    boughtCampaign.value.text,
              'tax-rate': totalPriceDetails.VAT == 1.21 ? 21 : 0,
              price: boughtCampaign.value.costEUR,
            });
          }
        });
      });
  });

  // if (totalPriceDetails.discountInUSD) {
  //   boughtCampaigns.push({
  //     quantity: 1,
  //     description: 'Black Friday discount',
  //     'tax-rate': totalPriceDetails.VAT == 1.21 ? 21 : 0,
  //     price: -totalPriceDetails.discountInUSD,
  //   });
  // }

  boughtCampaigns.push({
    quantity: 1,
    description: 'Payment fee',
    'tax-rate': 0,
    price: totalPriceDetails.paymentFee ? totalPriceDetails.paymentFee : 0,
  });

  totalPriceDetails.coupons.length != 0 &&
    totalPriceDetails.coupons.map((coupon) => {
      boughtCampaigns.push({
        quantity: 1,
        description: 'Discount: ' + coupon.result.name,
        'tax-rate': totalPriceDetails.VAT == 1.21 ? 21 : 0,
        price: -coupon.result.discount,
      });
    });

  var today = new Date();
  var dd = String(today.getDate()).padStart(2, '0');
  var mm = String(today.getMonth() + 1).padStart(2, '0'); //January is 0!
  var yyyy = today.getFullYear();

  today = dd + '-' + mm + '-' + yyyy;

  var data = {
    // Customize enables you to provide your own templates
    // Please review the documentation for instructions and examples
    customize: {
      //  "template": fs.readFileSync('template.html', 'base64') // Must be base64 encoded html
    },
    images: {
      // The logo on top of your invoice
      logo: '',
      // The invoice background
    },
    // Your own data
    sender: {
      company: 'DaimoonMedia',
      address: 'Marinestraat 1',
      zip: '3071PB',
      city: 'Rotterdam',
      country: 'NETHERLANDS',
      custom1: 'NL003087221B55',
      custom2: 'www.daimoon.media',
    },
    // Your recipient
    client: {
      company:
        customerDetails.company == true
          ? customerDetails.company_details.campany_name
          : '',

      address: customerDetails.address,
      zip: customerDetails.postal_code,
      city: customerDetails.city,
      country: customerDetails.country.countryCode,
      custom1: customerDetails.fullname,
      custom2: customerDetails.email,
      custom3:
        customerDetails.company == true
          ? customerDetails.company_details.vat_number
          : '',
      // "custom3": "custom value 3"
    },
    information: {
      // Invoice number
      number: '#' + order_id,
      // Invoice data
      date: today,
      // Invoice due date
      'due-date': 'Paid',
    },
    // The products you would like to see on your invoice
    // Total values are being calculated automatically
    products: boughtCampaigns,
    // The message you would like to display on the bottom of your invoice
    'bottom-notice':
      'Thank you ' +
      customerDetails.fname +
      '. We will start your campaign soon',
    // Settings to customize your invoice
    settings: {
      currency: 'EUR', // See documentation 'Locales and Currency' for more info. Leave empty for no currency.
      // "locale": "nl-NL", // Defaults to en-US, used for number formatting (See documentation 'Locales and Currency')
      // "tax-notation": "gst", // Defaults to 'vat'
      // "margin-top": 25, // Defaults to '25'
      // "margin-right": 25, // Defaults to '25'
      // "margin-left": 25, // Defaults to '25'
      // "margin-bottom": 25, // Defaults to '25'
      // "format": "A4", // Defaults to A4, options: A3, A4, A5, Legal, Letter, Tabloid
      // "height": "1000px", // allowed units: mm, cm, in, px
      // "width": "500px", // allowed units: mm, cm, in, px
      // "orientation": "landscape", // portrait or landscape, defaults to portrait
    },
    // Translate your invoice to your preferred language
    translate: {
      // "invoice": "FACTUUR",  // Default to 'INVOICE'
      // "number": "Nummer", // Defaults to 'Number'
      // "date": "Datum", // Default to 'Date'
      // "due-date": "Verloopdatum", // Defaults to 'Due Date'
      // "subtotal": "Subtotaal", // Defaults to 'Subtotal'
      // "products": "Producten", // Defaults to 'Products'
      // "quantity": "Aantal", // Default to 'Quantity'
      // "price": "Prijs", // Defaults to 'Price'
      // "product-total": "Totaal", // Defaults to 'Total'
      // "total": "Totaal" // Defaults to 'Total'
    },
  };

  easyinvoice.createInvoice(data, function (result) {
    easyinvoice.download('invoice-' + '#' + order_id + '.pdf', result.pdf);
  });
};

export { generateInvoice };
